import React, { useState } from 'react';
import { Container, Form, Button } from 'react-bootstrap';
import { supabase } from '../supabaseClient';

const AddRadny = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [position, setPosition] = useState('');
  const [party, setParty] = useState('');
  const [email, setEmail] = useState('');
  const [photoUrl, setPhotoUrl] = useState('');
  const [description, setDescription] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    const { error } = await supabase
      .from('radni')
      .insert([{ first_name: firstName, last_name: lastName, position, party, email, photo_url: photoUrl, description }]);

    if (error) {
      alert('Error adding radny');
    } else {
      alert('Radny added successfully');
      // Clear form fields
      setFirstName('');
      setLastName('');
      setPosition('');
      setParty('');
      setEmail('');
      setPhotoUrl('');
      setDescription('');
    }
  };

  return (
    <Container className="mt-5">
      <h1>Dodaj nowego radnego</h1>
      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="formFirstName">
          <Form.Label>ImiÄ™</Form.Label>
          <Form.Control type="text" value={firstName} onChange={(e) => setFirstName(e.target.value)} required />
        </Form.Group>

        <Form.Group controlId="formLastName">
          <Form.Label>Nazwisko</Form.Label>
          <Form.Control type="text" value={lastName} onChange={(e) => setLastName(e.target.value)} required />
        </Form.Group>

        <Form.Group controlId="formPosition">
          <Form.Label>Stanowisko</Form.Label>
          <Form.Control type="text" value={position} onChange={(e) => setPosition(e.target.value)} required />
        </Form.Group>

        <Form.Group controlId="formParty">
          <Form.Label>Partia</Form.Label>
          <Form.Control type="text" value={party} onChange={(e) => setParty(e.target.value)} required />
        </Form.Group>

        <Form.Group controlId="formEmail">
          <Form.Label>Email</Form.Label>
          <Form.Control type="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
        </Form.Group>

        <Form.Group controlId="formPhotoUrl">
          <Form.Label>Link do zdjÄ™cia</Form.Label>
          <Form.Control type="text" value={photoUrl} onChange={(e) => setPhotoUrl(e.target.value)} required />
        </Form.Group>

        <Form.Group controlId="formDescription">
          <Form.Label>Opis</Form.Label>
          <Form.Control as="textarea" rows={3} value={description} onChange={(e) => setDescription(e.target.value)} required />
        </Form.Group>

        <Button variant="primary" type="submit" className="mt-3">Dodaj radnego</Button>
      </Form>
    </Container>
  );
};

export default AddRadny;
